INSERT INTO `projetos` VALUES (18,'A EstÃ©tica das Pequenas Coisas na Arte ContemporÃ¢nea Brasileira','Este projeto de pesquisa propÃµe uma investigaÃ§Ã£o sobre como elementos do cotidiano â€” objetos, gestos, rotinas e experiÃªncias comuns â€” sÃ£o ressignificados e transformados em expressÃ£o artÃ­stica na arte contemporÃ¢nea brasileira. AtravÃ©s da anÃ¡lise de obras visuais, performances e instalaÃ§Ãµes de artistas que exploram a estÃ©tica do trivial, busca-se compreender como a arte se aproxima da vida real, revelando beleza, crÃ­tica e sensibilidade nas pequenas coisas.',2,'Edital PROPPI NÂº 04/2024','2024-04-12','2026-07-12','2026-10-20',1),(19,'Estudos de Personagem a ConstruÃ§Ã£o CÃªnica a partir de ExperiÃªncias Reais','O projeto tem como foco principal contribuir para o aprimoramento da formaÃ§Ã£o artÃ­stica, bem como explorar o teatro como espaÃ§o de escuta, cura e transformaÃ§Ã£o subjetiva.',1,'Edital PROPPI NÂº 03/2025','2025-04-10','2026-04-10',NULL,1),(20,'Fragmentos de Cena','O projeto â€œFragmentos em Cenaâ€ investiga a criaÃ§Ã£o teatral a partir de recortes narrativos, memÃ³rias pessoais, imagens poÃ©ticas e vivÃªncias cotidianas que, juntos, compÃµem um mosaico de cenas fragmentadas.\n',2,'Edital PROPPI NÂº 06/2025','2025-06-12','2026-06-12',NULL,1),(21,'ARTE CICLO','O ARTE-CICLO Ã© um grupo interdisciplinar dedicado Ã  investigaÃ§Ã£o teÃ³rico-prÃ¡tica das relaÃ§Ãµes entre arte, natureza e sustentabilidade no contexto contemporÃ¢neo.\n',1,'Edital PROPPI NÂº 08/2022','2022-08-20','2024-08-20',NULL,1),(22,'Entre Pigmentos e Possibilidades','Este projeto propÃµe uma abordagem interdisciplinar sobre o uso da tinta na produÃ§Ã£o artÃ­stica, explorando sua materialidade, simbolismo e potencial expressivo.',1,'Edital PROPPI NÂº 01/2018','2018-03-20','2020-03-20',NULL,1),(23,'Escrita Criativa e Subjetividade','A proposta se concentra em processos de escrita criativa â€” como poesia, crÃ´nicas, autobiografias e narrativas ficcionais â€” que permitam aos estudantes experimentar a linguagem como espaÃ§o de escuta, invenÃ§Ã£o e pertencimento.',2,'Edital PROPPI NÂº 02/2022','2022-04-10','2023-10-30',NULL,1),(24,'Ambientes em Alerta','Por meio de oficinas, projetos de intervenÃ§Ã£o, atividades artÃ­sticas e rodas de conversa, o projeto busca estimular a reflexÃ£o sobre os impactos das aÃ§Ãµes humanas na natureza e fomentar atitudes sustentÃ¡veis no contexto escolar e comunitÃ¡rio.',2,'Edital PROPPI NÂº 05/2014','2014-05-20','2017-03-20',NULL,1),(25,'Cor e ResistÃªncia','Por meio da anÃ¡lise de produÃ§Ãµes visuais, performances, expressÃµes populares e manifestaÃ§Ãµes culturais de artistas racializados, busca-se compreender como a linguagem artÃ­stica atua na desconstruÃ§Ã£o de estereÃ³tipos, na valorizaÃ§Ã£o das identidades negras e na afirmaÃ§Ã£o da ancestralidade afro-brasileira.',1,'Edital PROPPI NÂº 10/2023','2023-10-20','2025-10-20',NULL,1),(26,'Grupo de Estudos em Gerontologia','O GERA Ã© um grupo de pesquisa interdisciplinar dedicado ao estudo do envelhecimento humano a partir da perspectiva da Gerontologia. O objetivo principal Ã© compreender os mÃºltiplos fatores que impactam o processo de envelhecimento â€” incluindo aspectos biolÃ³gicos, psicolÃ³gicos, sociais, culturais e tecnolÃ³gicos â€” e contribuir para a construÃ§Ã£o de polÃ­ticas pÃºblicas, aÃ§Ãµes educativas e prÃ¡ticas inclusivas voltadas Ã  populaÃ§Ã£o idosa.\n',2,'Edital PROPPI NÂº 12/2021','2022-03-20','2027-03-20',NULL,1);
